import React from 'react';
import './List.css';

const List = ({ edges }) => (
  <div className="list">
    <h3>Список Ребер</h3>
    <ul>
      {edges.map((e,i)=><li key={i}>V{e.from} → V{e.to}</li>)}
    </ul>
  </div>
);

export default List;
